蘇澳頂寮城隍廟位於蘇澳鎮育英國小操場北側，與南側的龍德城隍廟，形成在一個學校兩端同時可見到兩座城隍廟的特殊地景。頂寮村原位於今利澤工業區內，在村子北側原有座有應媽廟（正安堂），南邊有間有應公廟，兩間祠廟因神蹟顯赫，故被居民尊稱為「大正公」、「大正媽」。後因利澤工業區的開發，頂寮全村被迫遷村，廟中所有祠廟亦需拆除遷建。民眾即請示有應公與有應媽是否願意在新址合祀一廟，並獲允許。1984年新廟完工後，即由時任縣長的陳定南撰寫中門門聯慶賀並冊封其為「城隍廟」。

